import React from "react";
import { Link } from "react-router-dom";
import ReadAdd from "../components/createData";

const Create = () => {
  return (
    <div>
      <h1>Add Page</h1>
      <Link to="/list">
        <button className="head">추가</button>
      </Link>
      <ReadAdd/>
    </div>
  );
};

export default Create;
